import React from "react";


function Slide_Product(){
    return(
        <>
         <li>
             <div className="top_slide" >
                 <img src={props.t} alt="" className="img" ></img>
             </div>
             <span  className="p" > All Categories </span>
         </li>
        </>
    );
}

export default Slide_Product;
